import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="card">
      <h1 className="company-name"> Company name</h1>
      <img className="chip-phone" />
      <h1 className="card-number"> 1351254895622222222</h1>
      <h1 className="valid-thru"> 12/80</h1>
      <h1 className="card-holder"> 12/80</h1>
      </div>
    </div>
  );
}

export default App;
